import { useEffect } from 'react';
import { Main } from '../Component';

const Password = () => {
    useEffect(() => document.title = "Password Verification - Authentication")
    return (
        <>
            <Main label="Password" labelWidth={80} type="password" />
        </>
    )
}

export default Password
